import React from 'react'
import NavBar from './components/NavBar'
import { makeStyles } from '@material-ui/core/styles';


const useStyles = makeStyles((theme) => ({
    home: {
        textAlign: 'center',
    },
}));

const Home = () => {
    const classes = useStyles();

    return(
        <div className={classes.home}>
            <NavBar/>
        </div>
    )
}

export default Home
